import React from "react";
import NavBar from "./NavBar.js";
import Table from './usersbackenddummy';
import './users.css';
import UserIcon from '@material-ui/icons/Person';

function Users() {
    return (
        <div className="front">
            <NavBar class="top" />
            <h1>유저정보</h1>
            <h3><UserIcon className="icon"></UserIcon></h3>
            <Table/>
        </div>
    );
}

export default Users;
